window.bookSummaryJSON = "<p>A misunderstanding turned deadly. A fairy in law enforcement who won't stop until the truth is uncovered. A vampire who seems to be her ally (but appearances can be deceiving). And a partner who would put his own life on the line to defend hers. </p><p>Dulcie O'Neil knows she's at fault for failing to arrest a wanted criminal, but when her partner gets pinned for the crime, she'll stop at nothing to ensure his innocence. What Dulcie isn't planning on is a trip to the infamous Netherworld where chaos rules. Between battling the affections of a mysterious vampire, protecting herself from monsters, and ensuring the innocence of the one man who would die for her, Dulcie's trip to the Netherworld isn't sunshine and strawberry daiquiris.</p>"; 
